import React, { useRef } from 'react'

function Input({ name }) {
  const username = useRef()

  return (
    <div className="form-group">
      <label htmlFor={name}>UserName</label>
      <input
        type="text"
        autoFocus
        ref={name}
        id={name}
        className="form-control"
      ></input>
    </div>
  )
}

export default Input
